column8:
片手で瓶を握る動作だけで栓が抜ける、ユニークな栓抜きです。<br>
GrOpenerを王冠に引っ掛け、あとは“握手をするように”瓶を握る動作だけ、簡単に開栓できます。<br>
本体には磁石が埋め込まれ、外れた王冠をキャッチします。また、本体を冷蔵庫などに付けておく事も可能です。<br>
ブラックとメタルは、硬質アルマイト加工が施されたハードコートモデルです。<br>
<br>製品の詳細<br>
製品サイズ：45.5 x 96.5 x 12.9 mm<br>
製品の重量：52g<br>
製品カラー：メタル（ハードコート）<br>
正規輸入品：アメリカ製<br><h2>Grab Opener</h2>
<font size="2" color="#464646">
片手で瓶を握る動作だけで栓が抜ける、ユニークな栓抜きGrOpener（ジーアール・オープナー）。 GrOpenerを王冠に引っ掛け、あとは瓶を握る動作だけで簡単に開栓できます。3色のスタンダードモデルと、硬質アルマイト加工が施された2色のハードコートモデルがございます。</font>
